b'from flask import Flask, request, render_template, jsonify, redirect, url_for

from .db import queries
from .file_handing.recipes import manage_txt, manage_img
from .gpt_integration import openai_integration as gpt

class WebApp:

    def __init__(self):        
        self.app = Flask(__name__, template_folder='templates', static_folder='static')        
        self.setup_routes()

    def run(self):
        #self.app.logger.disabled = True         #! Deshabilitar el logger de Flask
        #log = logging.getLogger('werkzeug')     #! Deshabilitar el logger de Werkzeug
        #log.disabled = True                     #! Deshabilitar el logger de Werkzeug

        self.app.run(debug=False)

    #*-------------------------------------------------------------------------------------------------------------------
    #*--------------------------------------------------- ROUTES FLASK---------------------------------------------------
    #*-------------------------------------------------------------------------------------------------------------------

    def setup_routes(self):
        @self.app.route("/")
        def home():
            return render_template("home.html")
        
        #?---------------------------------------------------------------------------------------------------------------------------------------
        #?-------------------------------------------------------------- MAIN ROUTES-------------------------------------------------------------
        #?---------------------------------------------------------------------------------------------------------------------------------------

        @self.app.route("/kitchen")
        def kitchen():
            return render_template("kitchen/kitchen.html")
        
        #!--------------------------------------------------------------------------------------------------------------------------------------
        #!------------------------------------------------------------ RECIPES ROUTES ----------------------------------------------------------
        #!--------------------------------------------------------------------------------------------------------------------------------------
        
        @self.app.route("/kitchen/recipes") 
        @self.app.route("/kitchen/recipes/<int:recipe_id>")       
        def recipes(recipe_id=None, recipes=None):            
            
            #list_dic_recipes = queries.fill_dic_recipes_from_db()       # Extraemos de TBL_Recipes, el id, nombre, procedimiento, alergenos y ruta de la imagen de cada receta
   
            list_dic_recipes = queries.cargar_datos_recetas() # Extraemos de TBL_Recipes, de TBL_RecipeIngredients y de TBL_RecipeEquipment.

            print(f"list_dic_recipes: {list_dic_recipes}")
            
            #! Deberian cargar las categorias desde la base de datos desde la tabla TBL_Category_Recipe, necesitamos el ID de la categoria para poder manipularla despues
            list_dic_categories = queries.fill_dic_categories_from_db() # Extraemos de TBL_Category_Recipe, el id y nombre de cada categoria de receta         
            
            if list_dic_recipes is None:               
                list_dic_categories = []            

            return render_template("kitchen/recipes.html", recipes=list_dic_recipes, list_dic_categories=list_dic_categories, selected_recipe_id=recipe_id)
        

        #? -----------------------------------------------------------------------------------------
        #? -------------------------------- LOAD RECIPES FROM --------------------------------------
        #? -----------------------------------------------------------------------------------------

        @self.app.route("/recipes/load_recipe_from_txt", methods=["POST"])        
        def load_recipe_from_txt(): #Deberia ser 'upload_recipes_from_txt'
            if 'recipe_file' not in request.files:
                return redirect(request.url)  # Redirecciona si no hay archivo

            file = request.files['recipe_file']
            if file.filename == '':
                return redirect(request.url)  # Redirecciona si el nombre del archivo est\xc3\xa1 vac\xc3\xado

            # Procesa el archivo aqu\xc3\xad
            file_path = "app/data/" + file.filename
            file.save(file_path)    
            # Puedes ahora enviar la ruta a otra funci\xc3\xb3n que maneje el archivo
                    
            manage_txt.load_txt_in_bd(file_path)

            return redirect(url_for('recipes'))  # Redirecciona a la p\xc3\xa1gina de recetas despu\xc3\xa9s del procesamiento
        
        @self.app.route("/recipes/load_recipe_from_db", methods=["POST"])
        def load_recipe_from_db():
            ...

        @self.app.route("/recipes/load_recipe_from_excel/<recipe_id>", methods=["GET"])
        def load_recipe_from_excel(recipe_id):
            ...        

        #? -----------------------------------------------------------------------------------------
        #? -------------------------------- QUERIES RECIPE -----------------------------------------   
        #? -----------------------------------------------------------------------------------------


        @self.app.route('/update_recipe', methods=['POST'])
        def update_recipe():
            category = request.form['recipe_category']
            recipe_id = request.form['recipe_id']            
            nameRecipe = request.form['recipe_name']
            ingredients = request.form['ingredients']
            procedure = request.form['procedure']
            equipment = request.form['equipment']
            allergens = request.form['allergens']
            
            print(f"category: {category}")
            print(f"recipe_id: {recipe_id}")
            print(f"nameRecipe: {nameRecipe}")
            print(f"ingredients: {ingredients}")
            print(f"procedure: {procedure}")
            print(f"equipment: {equipment}")
            print(f"allergens: {allergens}")
            


            file_path_flask = manage_img.save_img_recipe(request)
            
            if queries.update_full_recipe(category, nameRecipe, ingredients, procedure, equipment, allergens, file_path_flask, recipe_id):
                return jsonify({'status': 'success'})
            else:
                return jsonify({'status': 'error'})
            
        @self.app.route('/new_recipe', methods=['POST'])
        def new_recipe():
            category = request.form['recipe_category']
            nameRecipe = request.form['recipe_name']            
            ingredients = request.form['ingredients']
            procedure = request.form['procedure']
            equipment = request.form['equipment']
            allergens = request.form['allergens']
            
            file_path_flask = manage_img.save_img_recipe(request)

            if queries.insert_recipe(category, nameRecipe, ingredients, procedure, equipment, allergens, file_path_flask):
                return jsonify({'status': 'success'})
            else:
                return jsonify({'status': 'error'})
            
        @self.app.route('/update_category_recipe', methods=['POST'])
        def update_category_recipe():
            category_recipe_id = request.form['category_recipe_id']
            category_recipe_name = request.form['category_recipe_name']

            print(f"category_recipe_id: {category_recipe_id}")
            print(f"category_recipe_name: {category_recipe_name}")
            
            if queries.update_category_recipe(category_recipe_id, category_recipe_name):
                return jsonify({'status': 'success'})
            else:
                return jsonify({'status': 'error'})
    
        #!--------------------------------------------------------------------------------------------------------------------------------------
        #!------------------------------------------------------------------- IA ---------------------------------------------------------------
        #!--------------------------------------------------------------------------------------------------------------------------------------        
     
        @self.app.route("/AI/babalu_ai")
        def babalu_ai():
            return render_template("/AI/babalu_ai.html")        

        #?------------------------------------------------------------------------
        #?------------- FUNCIONES AUXILIARES PARA EL MANEJO DEL CHAT -------------
        #?------------------------------------------------------------------------

        @self.app.route('/gpt_answer', methods=['POST'])
        def manejar_chat():
            BABALU_ASSISTANT_ID = "asst_OrLBfAr78vxpeeIFrsrGhFkK"  # ID del asistente de 'Cafe Manager Mulilingual Pro'

            data = request.json
            mensaje_usuario = data['mensaje']
            thread_id = data.get('thread_id')  # Recuperar el ID del hilo si est\xc3\xa1 presente

            print(f"---------------------- mensaje_usuario: {mensaje_usuario}")

            respuesta = gpt.menejar_hilo_chat(BABALU_ASSISTANT_ID, mensaje_usuario, thread_id)

            print(f"---------------------- respuesta: {respuesta}")

            # Aseg\xc3\xbarate de que la respuesta no est\xc3\xa9 vac\xc3\xada antes de intentar acceder al \xc3\xbaltimo elemento
            if respuesta:
                ultimo_mensaje = respuesta[-1].content[0].text.value                
                return jsonify({'respuesta': ultimo_mensaje, 'thread_id': thread_id})
            else:
                return jsonify({'respuesta': "No se recibi\xc3\xb3 respuesta del asistente", 'thread_id': thread_id})            


        
        


if __name__ == "__main__":    
    web_app = WebApp()
    web_app.run()
