b"import { activateSaveButton } from './recipes/saveRecipeButton.js';

export function makeElementEditable(elementId, saveButtonId) {
    const editableElement = document.getElementById(elementId);
    
    if (!editableElement) return; // Si el div no existe, no hacer nada

    editableElement.addEventListener('click', function() {
        this.contentEditable = true;    //contentEditable es un atributo de html que permite editar el contenido de un elemento
        this.focus();                   //focus es cuando se hace click en el elemento
        this.classList.add('bg-orange-100', 'border-orange-300');                    
        this.style.color = 'black';
    });

    editableElement.addEventListener('blur', function() {
        this.contentEditable = false;
        this.classList.remove('bg-orange-100', 'border-orange-300');                     
        this.style.color = ''; // Restaurar el color del texto
    });

    editableElement.addEventListener('input', function() {
        // Habilitar el bot\xc3\xb3n cuando el texto del div cambie
        this.style.color = 'black';
        activateSaveButton(saveButtonId)
    });
}

"

