b"export function setupMoveToTopButton() {            
    // A\xc3\xb1adir evento de cambio a los campos de la receta
    document.querySelectorAll('.editable-div').forEach(div => {
        div.addEventListener('input', () => showButton('move_to_the_top_web'));
    });

    // Manejar clic en el div 'move_to_the_top_web'
    document.getElementById('move_to_the_top_web').addEventListener('click', function() {        
        scrollToId('btn_save', 'smooth');       
    });   
}   

// Funci\xc3\xb3n para hacer scroll a un elemento
// behavior: 'smooth' o 'auto', define la animaci\xc3\xb3n del scroll
// id: id del elemento al que se quiere hacer scroll
function scrollToId(id, behavior) {
    var elementToScrollTo = document.getElementById(id);
    var topPos = elementToScrollTo.offsetTop;
    var offset = 25;    // Offset para que el elemento no quede pegado al borde superior de la pantalla

    window.scrollTo({
        top: topPos - offset,
        left: 0,
        behavior: behavior
    });
}

// Funci\xc3\xb3n para mostrar el bot\xc3\xb3n 'move_to_the_top_web'
function showButton(id) {
    document.getElementById(id).classList.remove('hidden');
}"

