export function unsetCurrentActiveButtonBackground(button) {
    if (!button || !button.classList) {
        console.error('toggleActiveButton: El bot\xc3\xb3n proporcionado no es v\xc3\xa1lido.');
        return;
    }

    let currentActiveButton = getActiveButton(); 
    if (currentActiveButton && currentActiveButton.classList) {
        currentActiveButton.classList.remove('bg-orange-900');
    }

    button.classList.add('bg-orange-900');
    setActiveButton(button);
}"

