b"import { saveRecipe } from '../../services/recipeService.js';
import { getActiveButton, getSelectedImageFile } from '../../utils/stateManager.js';

export function setupSaveRecipeButton() {
    // Agregar evento click al bot\xc3\xb3n de guardar receta
    document.getElementById('btn_save').addEventListener('click', function () {
        if (!this.disabled) {
            let [recipeId, recipeUrl] = getIdRecipe();
            let [category_recipe, recipe_name, ingredients, procedure_recipe, equipment, allergens_recipe] = getDataFromRecipe();
            var formData = createFormData(recipeId, category_recipe, recipe_name, ingredients, procedure_recipe, equipment, allergens_recipe);
            saveRecipe(recipeUrl, formData);
        }
    });

    function createFormData(recipeId, category_recipe, recipe_name, ingredients, procedure_recipe, equipment, allergens_recipe) {
        var formData = new FormData();
        formData.append('recipe_category', category_recipe);
        formData.append('recipe_id', recipeId);
        formData.append('recipe_name', recipe_name);
        formData.append('recipe_image', getSelectedImageFile()); // Si est\xc3\xa1s enviando una imagen
        formData.append('ingredients', JSON.stringify(ingredients)); // Aseg\xc3\xbarate de que sea un string JSON v\xc3\xa1lido
        formData.append('procedure', procedure_recipe);
        formData.append('equipment', JSON.stringify(equipment)); // Aseg\xc3\xbarate de que sea un string JSON v\xc3\xa1lido
        formData.append('allergens', allergens_recipe);

        return formData;
    }

    function getDataFromRecipe() {
        const category_recipe = document.getElementById('select-category-recipe').selectedIndex + 1;
        const recipe_name = document.getElementById('recipe-name').innerText;
        const ingredients = extractDataFromTable('recipe-ingredients');
        const procedure_recipe = document.getElementById('recipe-procedure').innerText;
        const equipment = extractDataFromTable('recipe-equipment');
        const allergens_recipe = document.getElementById('recipe-allergens').innerText;  

        return [category_recipe, recipe_name, ingredients, procedure_recipe, equipment, allergens_recipe];      
    }
    
    function extractDataFromTable(tableId) {
        const table = document.getElementById(tableId);
        if (!table) {
            console.error('Tabla no encontrada:', tableId);
            return [];
        }
    
        const rows = table.getElementsByTagName('tr');
        const data = [];
    
        for (let i = 1; i < rows.length; i++) {
            const cells = rows[i].getElementsByTagName('td');
            if (cells.length < 4) {
                console.warn('Fila encontrada con menos de 4 celdas, fila ignorada:', i);
                continue;
            }
    
            const rowData = {
                id_ingredient: cells[0].innerText.trim(),   // Cambiado de 'id' a 'id_ingredient' para ingredientes
                ingredient_name: cells[1].innerText.trim(), // Cambiado de 'name' a 'ingredient_name' para ingredientes
                quantity: cells[2].innerText.trim(),
                unit_quantity: cells[3].innerText.trim()    // Cambiado de 'unit' a 'unit_quantity' para ingredientes
            };
            data.push(rowData);
        }
    
        return data;
    }
    
    function getIdRecipe() {
        let recipeId;
        let recipeUrl;
        let currentActiveButton = getActiveButton();

        console.log('currentActiveButton: ', currentActiveButton);
        if (currentActiveButton.id == 'btn_add_recipe') {
            recipeId = 'NEW RECIPE';
            recipeUrl = '/new_recipe';
        } else {
            recipeId = currentActiveButton.dataset.recipeId;     // currentActiveButton es el bot\xc3\xb3n que se ha presionado en el recetario
            recipeUrl = '/update_recipe';
        }

        return [recipeId, recipeUrl];
    }
}

export function disableSaveButton(saveButtonId) {
    const saveButton = document.getElementById(saveButtonId);
    saveButton.disabled = true;
    saveButton.classList.add('opacity-50', 'cursor-not-allowed');
    saveButton.classList.remove('opacity-100', 'cursor-pointer');
}

export function activateSaveButton(saveButtonId) {
    const saveButton = document.getElementById(saveButtonId);
    saveButton.disabled = false;
    saveButton.classList.remove('opacity-50', 'cursor-not-allowed');
    saveButton.classList.add('opacity-100', 'cursor-pointer');
}
"

b"export function initializeGptMainAssistantPage(){
   
    let threadId = null; // Inicializa el ID del hilo de conversaci\xc3\xb3n

    const enviarMensaje = document.getElementById('enviarMensaje');
    const mensajeUsuario = document.getElementById('mensajeUsuario');
    const chat = document.getElementById('chat');

    mensajeUsuario.addEventListener('keypress', function(event) {
        if (event.key === 'Enter') {
            event.preventDefault(); // Previene el env\xc3\xado del formulario si est\xc3\xa1 dentro de uno
            const mensaje = this.value.trim(); // Obtiene y limpia el texto del campo de entrada
    
            if (mensaje) { // Verifica que el mensaje no est\xc3\xa9 vac\xc3\xado
                enviarMensaje.click(); // Simula un clic en el bot\xc3\xb3n enviarMensaje
            }
        }
    });

    enviarMensaje.addEventListener('click', function () {
        const mensaje = mensajeUsuario.value.trim();
        if (mensaje) {
            addMessageToChat('usuario', mensaje); // Agrega el mensaje del usuario al chat
            mensajeUsuario.value = '';

            addMessageToChat('carga', '.'); // Agrega un mensaje de carga al chat

            const intervaloCarga = actualizarMensajeCarga(); // Actualiza el mensaje de carga

            // Prepara los datos a enviar
            const datosEnvio = {
                mensaje: mensaje,
                thread_id: threadId // Incluye el threadId si est\xc3\xa1 disponible
            };

            // Env\xc3\xada el mensaje al servidor
            fetch('/gpt_answer', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(datosEnvio)
            })
            .then(response => response.json())
            .then(data => {
                addMessageToChat('ai', data.respuesta); // Agrega la respuesta del servidor al chat
                threadId = data.thread_id; // Actualiza el threadId con el valor devuelto por el servidor

                removeLoadMessage(intervaloCarga, chat); // Elimina el mensaje de carga del chat
            })
            .catch(error => {
                console.error('Error al enviar el mensaje:', error);                    
                removeLoadMessage(intervaloCarga, chat)
            });
        }
    });

    function removeLoadMessage(intervaloCarga, chat) {
        clearInterval(intervaloCarga);
        const divCarga = document.getElementById('mensajeCarga');
        if (divCarga) {
            chat.removeChild(divCarga);
        }
    }

    //----------------------------------- Agregar mensaje al chat en el frontend -----------------------------------
    function addMessageToChat(remitente, texto) {
        const div = document.createElement('div');
        div.className = remitente === 'usuario' ? 'mensaje-usuario' : remitente === 'sistema' ? 'mensaje-sistema' : 'mensaje-ai';
    
        if (remitente === 'carga') {
            div.className = 'mensaje-carga';
            div.id = 'mensajeCarga'; // ID \xc3\xbanico para el mensaje de carga
        }

        const p = document.createElement(remitente === 'ai' ? 'pre' : 'p'); // Usa <pre> para los mensajes de AI
        p.className = 'mensaje';
        if (remitente === 'sistema') {
            p.innerHTML = texto; // Usa innerHTML para contenido que incluye HTML
        } else {
            p.textContent = texto; // Sigue usando textContent para los mensajes de usuario y AI
        }
    
        div.appendChild(p);
        chat.appendChild(div);
    
        // Desplaza el chat hacia el \xc3\xbaltimo mensaje
        chat.scrollTop = chat.scrollHeight;
    }

    // Funci\xc3\xb3n para actualizar el mensaje de carga
    function actualizarMensajeCarga() {
        let contador = 0;
        const intervalo = setInterval(() => {
            contador++;
            const divCarga = document.getElementById('mensajeCarga');
            if (divCarga) {
                divCarga.firstChild.textContent = '.'.repeat(contador % 4);
            } else {
                clearInterval(intervalo);
            }
        }, 500);
        return intervalo;
    }   
}


"

