// La funci\xc3\xb3n principal que inicializa la p\xc3\xa1gina de recetas
export function initializeRecipePage() {
    setupFileInput();

    console.log(recipesData)

    if (Object.keys(recipesData).length > 0) {
        // Panel Izquierdo --------------------------------------------
        setupRecipeButtons();
        setupNewRecipeButton();
        setupEditableCategoryRecipe();

        // Inicializar componentes-------------------------------------
        setupMoveToTopButton();
        
        setupEditableContent();
        setupSelectCategoryRecipe();

        // Inicializar eventos de botones y otros controles -----------
        setupSaveRecipeButton();
    }

}

function setupSelectCategoryRecipe() {
    const list_categories = categoriesData;                                     // categoriesData es una variable global que contiene todos los datos de las categorias, se encuentra en el archivo recipes.html    
    const selectElement = document.getElementById('select-category-recipe');
    const saveButton = document.getElementById('btn_save');

    // Llenar el select con las opciones
    list_categories.forEach(category => {
        const option = document.createElement('option');
        option.value = category.id_category_recipe;
        option.text = category.category_recipe_name;
        selectElement.appendChild(option);
    });

    selectElement.addEventListener('change', function () {
        this.classList.add('blinking')
        saveButton.disabled = false;
        saveButton.classList.remove('opacity-50', 'cursor-not-allowed');
        saveButton.classList.add('opacity-100', 'cursor-pointer');
    });
}

function disableButtonSaveRecipe() {
    const saveButton = document.getElementById('btn_save');
    saveButton.disabled = true;
    saveButton.classList.add('opacity-50', 'cursor-not-allowed');
    saveButton.classList.remove('opacity-100', 'cursor-pointer');
}

function disableButtonMoveToTop() {
    document.getElementById('move_to_the_top_web').classList.add('hidden');
}


function setupRecipeButtons() {
    document.querySelectorAll('button[data-recipe-id]').forEach(button => {           // Selecciona todos los botones que tengan el atributo data-recipe-id                
        button.addEventListener('click', function () {
            console.log('Se ha presionado el bot\xc3\xb3n de la receta: ' + this.dataset.recipeId);
            unsetCurrentActiveButtonBackground(this);

            disableButtonSaveRecipe(); // Deshabilitar el bot\xc3\xb3n de guardar receta
            disableButtonMoveToTop(); // Deshabilitar el bot\xc3\xb3n de mover al inicio

            document.getElementById('recipe-img').style.display = 'none';   // Ocultar el div de la imagen del recetario
            document.getElementById('recipe-details').style.display = 'block';  // Mostrar el div de los detalles de la receta  
            
            handleButtonClick(this.dataset.recipeId);   // Selecciona el id de la receta que se ha presionado, dataset es un objeto que contiene todos los atributos data-*, en este caso data-recipe-id, recipeId es el nombre del atributo.                    
            functionalitiesRecipeButtons();
        });
    });

    function functionalitiesRecipeButtons() {
        // Obtener la posici\xc3\xb3n del elemento 'tbn_save_updates'
        var elementToScrollTo = document.getElementById('recipe-name');
        var topPos = elementToScrollTo.offsetTop;
        var offset = 25;    // Offset para que el elemento no quede pegado al borde superior de la pantalla

        window.scrollTo({
            top: topPos - offset,
            left: 0,
            behavior: 'smooth'
        });
    }
}

function setupEditableContent() { 
    // Aplicar la funci\xc3\xb3n a cada div editable
    makeElementEditable('recipe-ingredients', 'btn_save');
    makeElementEditable('recipe-procedure', 'btn_save');
    makeElementEditable('recipe-equipment', 'btn_save');
    makeElementEditable('recipe-allergens', 'btn_save');
    makeElementEditable('recipe-name', 'btn_save');
}

function DeshabilitarButtonSaveCategoryRecipe(saveButton) {
    saveButton.disabled = true;
    saveButton.classList.add('opacity-50', 'cursor-not-allowed');
    saveButton.classList.remove('opacity-100', 'cursor-pointer');
    saveButton.classList.remove('blinking'); // A\xc3\xb1adir clase para parpadear
}

function setupEditableCategoryRecipe() {
    document.querySelectorAll('[data-category-recipe-id]').forEach(h2 => {           // Selecciona todos los h2 que tengan el atributo data-category-recipe-id                            

        const saveButtonID = 'btn_save_category_' + h2.dataset.categoryRecipeId;    //el atributo de dataset utiliza una nomenclatura camelCase, por lo que categoryRecipeId es el nombre del atributo, teniendo encuenta que el atributo es data-category-recipe-id
        const saveButton = document.getElementById(saveButtonID);

        h2.addEventListener('click', function () {
            this.contentEditable = true;
            this.focus();
            this.classList.add('bg-orange-100', 'border-orange-300');
            this.style.color = 'black';                            
        });

        h2.addEventListener('blur', function () {        //blur es cuando se pierde el foco del elemento, es decir, cuando se deja de hacer click en el elemento
            h2.contentEditable = false;
            h2.classList.remove('bg-orange-100', 'border-orange-300');
            h2.style.color = ''; // Restaurar el color del texto
        });

        h2.addEventListener('input', function () {
            this.style.color = 'black';
            saveButton.disabled = false;
            saveButton.classList.add('blinking'); // A\xc3\xb1adir clase para parpadear
            saveButton.classList.remove('opacity-50', 'cursor-not-allowed');
            saveButton.classList.add('opacity-100', 'cursor-pointer');
        });

        saveButton.addEventListener('click', function () {
            if (!this.disabled) {
                const categoryRecipeId = h2.dataset.categoryRecipeId;     
                const nameCategoryRecipe = h2.innerText;

                console.log('nameCategoryRecipe: ' + nameCategoryRecipe);

                var formData = new FormData();
                formData.append('category_recipe_id', categoryRecipeId);
                formData.append('category_recipe_name', nameCategoryRecipe);

                saveCategoryRecipe(formData)                 
                DeshabilitarButtonSaveCategoryRecipe(saveButton);
                
            }
        });
    });
}"

