export function loadRecipeDetails(recipe) {
    
    console.log("-------------------------------------------------------");
    console.log(recipe);

    if (recipe) {
        document.getElementById('select-category-recipe').selectedIndex = recipe.category_recipe - 1;
        document.getElementById('recipe-name').innerHTML = recipe.recipe_name;
        document.getElementById('recipe-ingredients').innerHTML = generateIngredientsHTML(recipe.ingredients);
        document.getElementById('recipe-equipment').innerHTML = generateEquipmentHTML(recipe.equipment);
        document.getElementById('recipe-allergens').innerHTML = convertirSaltosDeLineaAHtml(recipe.allergens_recipe);
        document.getElementById('recipe-procedure').innerHTML = convertirSaltosDeLineaAHtml(recipe.procedure_recipe);
    } else {
        document.getElementById('select-category-recipe').selectedIndex = 0;   //SELECCIONAMOS EL SELECTOR DE CATEGORIAS Y LE ASIGNAMOS EL VALOR DE LA CATEGORIA DE LA RECETA          
        document.getElementById('recipe-name').innerHTML = 'RECIPE NAME';
        document.getElementById('recipe-ingredients').innerHTML = '- Ingredient 1 <br> - Ingredient 2 <br> - Ingredient ...';
        document.getElementById('recipe-equipment').innerHTML = '- Equipment 1 <br> - Equipment 2 <br> - Equipment ...';
        document.getElementById('recipe-allergens').innerHTML = '- Allergens 1 <br> - Allergens 2 <br> - Allergens ...';
        document.getElementById('recipe-procedure').innerHTML = ' <b>-Step 1</b> <br> -... <br><b>-Step 2</b> <br> -... <br> <b>-Step ...</b> ';                        
    }

    function convertirSaltosDeLineaAHtml(texto) {
        // Reemplaza todos los '\n' en el texto con '<br>'
        return texto.replace(/\n/g, '<br>');
    }
      
        // Funci\xc3\xb3n para generar HTML para los ingredientes
        function generateIngredientsHTML(ingredients) {
            let tableHTML = `<table class="styled-table">
                                <thead>
                                    <tr>
                                        <th>ID</th>
                                        <th>Name</th>
                                        <th>Quantity</th>
                                        <th>Unit</th>
                                    </tr>
                                </thead>
                                <tbody>`;

            ingredients.forEach(ing => {
                tableHTML += `<tr>
                                <td>${ing.id_ingredient}</td>
                                <td>${ing.ingredient_name}</td>
                                <td>${ing.quantity}</td>
                                <td>${ing.unit_quantity}</td>
                            </tr>`;
            });

            tableHTML += `</tbody></table>`;

            return tableHTML;
        }

        // Funci\xc3\xb3n para generar HTML para el equipo
        function generateEquipmentHTML(equipment) {
            let tableHTML = `<table class="styled-table">
                                <thead>
                                    <tr>
                                        <th>ID</th>
                                        <th>Equipment name</th>
                                        <th>Comment</th>
                                    </tr>
                                </thead>
                                <tbody>`;

            equipment.forEach(eq => {
                tableHTML += `<tr>
                                <td>${eq.id_equipment}</td>
                                <td>${eq.equipment_name}</td>
                                <td>${eq.comment}</td>
                            </tr>`;
            });

            tableHTML += `</tbody></table>`;

            return tableHTML;
        }
}


export function loadRecipeImage(recipe, recipeId) {
    
    if (recipe == null) {
        recipe = {};
    }

    const imageSrc = recipe.dir_images_recipe == null ? "/static/img/decorations/no-imagen.png" : recipe.dir_images_recipe;
    
    document.getElementById('recipe-image').innerHTML = `
        <div>
            <input type="hidden" name="recipe_id" id="hiddenRecipeId">
            <input type="file" id="imageInput" name="recipe_image" accept="image/*" style="display: none;">
            <label for="imageInput" class="w-full h-full object-cover rounded">                                                                    
                <div class="text-blue-600 mb-2 flex justify-center items-center">
                    <img src="${imageSrc}" alt="Imagen Descriptiva" class="w-full h-full object-cover rounded">
                </div>                                
            </label>
        </div>                    
    `;
    
    setupImageUploadForm(); 
}                                 


export function saveRecipe(recipeUrl, formData){

    console.log("-------------------------------------------------------");
    console.log(recipeUrl);

    
    for (let [key, value] of formData.entries()) {
        console.log(`${key}: ${value}`);
    }
    

    fetch(recipeUrl, {
        method: 'POST',
        body: formData
    }).then(response => {
        if (response.ok) {
            alert('Succesful updating recipe');
                      
            
            document.getElementById('move_to_the_top_web').classList.add('hidden');
            

            //! Este codigo deberia ser optimizado.------------------------------------------------------------------------------------------
            deshabilitarParpadeo('label[for="imageInput"] img')     //label[for="imageInput"] img, es el selector de la imagen del recetario. 
            document.getElementById('select-category-recipe').classList.remove('blinking')
            disableSaveButton('btn_save');
            //! -----------------------------------------------------------------------------------------------------------------------------
        } else {
            alert('Error updating recipe');
        }
    });
}'

